import RegistrationForm from "../forms/RegistrationForm";
import React, { Component } from "react";

class RegistrationPage extends Component {
  render() {
    return (
      <>
        <h1>Register</h1>
        <RegistrationForm />
      </>
    );
  }
}

export default RegistrationPage;
